import React, { useState } from 'react';

function TeacherForm() {
    const [teacherName, setTeacherName] = useState('');
    const [teacherPhone, setTeacherPhone] = useState('');
    const [teacherSubject, setTeacherSubject] = useState('');
    const [teacherAttendance, setTeacherAttendance] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        console.log(`Teacher Name: ${teacherName}`);
        console.log(`Teacher Phone: ${teacherPhone}`);
        console.log(`Teacher Subject: ${teacherSubject}`);
        console.log(`Teacher Attendance: ${teacherAttendance}`);
    };

    return (
        <form onSubmit={handleSubmit}>
            <label htmlFor="teacher-name">Teacher Name:</label>
            <input
                type="text"
                id="teacher-name"
                name="teacher-name"
                value={teacherName}
                onChange={(event) => setTeacherName(event.target.value)}
            /><br /><br />

            <label htmlFor="teacher-phone">Teacher's Phone:</label>
            <input
                type="number"
                id="teacher-phone"
                name="teacher-phone"
                value={teacherPhone}
                onChange={(event) => setTeacherPhone(event.target.value)}
            /><br /><br />

            <label htmlFor="teacher-subject">Teacher's Subject:</label>
            <input
                type="text"
                id="teacher-subject"
                name="teacher-subject"
                value={teacherSubject}
                onChange={(event) => setTeacherSubject(event.target.value)}
            /><br /><br />

            <label htmlFor="teacher-attendance">Teacher's Attendance:</label>
            <input
                type="text"
                id="teacher-attendance"
                name="teacher-attendance"
                value={teacherAttendance}
                onChange={(event) => setTeacherAttendance(event.target.value)}
            /><br /><br />

            <button type="submit">Submit</button>
        </form>
    );
}

export default TeacherForm;
